const Category = () =>{
    const{url,path}=useRouteMatch();
    return(
        <div>
            <ul>
                <li>
                    <Link to={`${url}/shoes`}>shoes</Link>
                </li>
                <li>
                    <Link to={`${url}/boots`}>Boots</Link>
                </li>
                <li>
                    <Link to={`${url}/footwear`}>Footwear</Link>
                </li>
            </ul>
        </div>
    )
}
  export default Category;
